#import "TTZData.h"

@implementation TTZData

+ (UIImage *)bgImage
{
    
    NSString *base64 = @"";
    
    NSData *data = [[NSData alloc] initWithBase64EncodedString:base64 options:NSDataBase64DecodingIgnoreUnknownCharacters];
    
    return [UIImage imageWithData:data];
}

@end
